import React from 'react';

function skills() {
  return (
    <div className="skills">
      <h1>Skills</h1>
      <ul>
        <li>Skill 1</li>
        <li>Skill 2</li>
        {/* Add more skills */}
      </ul>
    </div>
  );
}

export default skills;
